#include <cstdio>
#include <vector>
#include <string>
#include <queue>
using namespace std;

class Solution {
private:
    int row;
    int col;

public:
    void solve(vector<vector<char> > &board) {
        row = board.size();
        if (row == 0) return;
        col = board[0].size();
        for (int j = 0; j < col; ++j)
        {
            if (board[0][j] == 'O')
                Dye(0,j,board);
            if (board[row-1][j] == 'O')
                Dye(row-1, j, board);
        }
        for (int i = 0; i < row; ++i)
        {
            if (board[i][0] == 'O')
                Dye(i,0,board);
            if (board[i][col-1] == 'O')
                Dye(i, col-1, board);
        }

        for (int i = 0; i < row; ++i)
            for (int j = 0; j < col; ++j)
                if (board[i][j] == 'O')
                    board[i][j] = 'X';
                else if (board[i][j] == '-')
                    board[i][j] = 'O';

        return;
    }

    void Dye(int x, int y , vector<vector<char> > &board){
        int direction[4][2] = {{-1,0},{1,0},{0,-1},{0,1}};
        queue<int> qx, qy;
        qx.push(x);
        qy.push(y);
        board[x][y] = '-';
        while (!qx.empty()){
            x = qx.front();
            y = qy.front();
            qx.pop();
            qy.pop();
            for (int i = 0; i < 4; i++){
                int x2 = direction[i][0] + x, y2 = direction[i][1] + y;
                if (x2 >= 0 && x2 < row && y2 >= 0 && y2 < col && board[x2][y2] == 'O'){
                    board[x2][y2] = '-';
                    qx.push(x2);
                    qy.push(y2);
                }
            }
        }
        return;
    }
    void Print(const vector<vector<char> > &board){
        for (int i = 0; i < board.size(); ++i)
        {
            for (int j = 0; j < board[0].size(); ++j)
            {
                printf("%c ", board[i][j]);
            }
            printf("\n");
        }
        printf("--------------------------------\n");
    }
};

